import React from 'react'
import MemberMovieWatched from './MemberMovieWatched'
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import {  useNavigate } from 'react-router-dom';


const MemberComp = ({member}) => {
    const navigate = useNavigate();

  return (

        <div style={{paddingBottom: '20px'}} >

      <Card style={{boxShadow: " rgba(0, 0, 0, 0.4) 0px 2px 4px, rgba(0, 0, 0, 0.3) 0px 7px 13px -3px, rgba(0, 0, 0, 0.2) 0px -3px 0px inset"}} sx={{ maxWidth: 345 }}>

      <Typography gutterBottom variant="h6" component="div">
      Name: {member.name} <br />
      Email: {member.email} <br />
      City: {member.city} <br />
      <button onClick={()=> navigate(`/members/editmember/${member._id}`)}>Edit</button>
      </Typography>
      <MemberMovieWatched id={member._id}/>


    <CardActions>
      {/* <Button onClick={editMovie} size="medium">Edit</Button>
      <Button onClick={deleteMovie} size="medium">Delete</Button> */}
    </CardActions>

  </Card>

    </div>
  )
}

export default MemberComp
